  static contextType = AppData; // ***** access via this.context
  render() {
    // main onClick $('.contact-info').removeClass('active');
    return (
      <React.Fragment>
        <main>
          <Aside />
          <div className="main-content">
            <Primary />
          </div>
          <Footer />
        </main>
      </React.Fragment>
    );
  }
}

export default Main;
